import Link from 'next/link';
import Header from '../components/Header';
import Layout from '../components/MyLayout';
import { Table, Tag } from 'antd';



const PostLink = props => (
    <li>
        <Link href={`/posts?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

const columns = [
    {
        title: 'Version No',
        dataIndex: 'name',
        key: 'name',
        render: text => <a>{text}</a>,
    },
    {
        title: 'Status',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Progress',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Start Date',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Releas--e Date',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Description',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Action',
        key: 'action',
        render: (text, record) => (
            <span>
                <a style={{ marginRight: 16 }}>Invite {record.name}</a>
                <a>Delete</a>
            </span>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        name: 'Jim Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];
export default function Blog() {
    return (
        <>
            <Layout>
                <h1>My Blog</h1>
                <ul>
                    <PostLink title="Hello Next.js page 1" />
                    <PostLink title="Awesome page 2" />
                    <PostLink title="Curfew today page 3" />
                </ul>
            </Layout>
            <Table columns={columns} dataSource={data} />
        </>
    )
}
